# Swap indexes 1 and 2
def swap(i1, i2):
    uh = list[i2]
    list[i2] = list[i1]
    list[i1] = uh

def bubblesort():
    for x in range(len(list)-1):
        for item in range(len(list)-1):
            if(list[item] > list[item+1]):
                swap(item, item+1)

